package com.example.collectorsApp.config;

import com.example.collectorsApp.dao.CoinRepository;
import com.example.collectorsApp.dao.StampRepository;
import com.example.collectorsApp.dao.WatchRepository;
import com.example.collectorsApp.dao.entity.Coin;
import com.example.collectorsApp.dao.entity.Stamp;
import com.example.collectorsApp.dao.entity.Watch;
import com.example.collectorsApp.login.models.ERole;
import com.example.collectorsApp.login.models.Role;
import com.example.collectorsApp.login.repository.RoleRepository;
import org.springframework.boot.CommandLineRunner;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;

import java.util.UUID;

@Configuration
public class InsertIngIntoDb {

    @Bean
    public CommandLineRunner coinDateToInitDb(CoinRepository repo) {
        return args -> {

            repo.save(
                    new Coin()
                            .coinCode(UUID.randomUUID().toString())
                            .coinName("Złotówka")
                            .dateOfProduction("2024")
                            .id(3422L)
                            .prizePln(1)
                            .imageUrl("data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/" +
                                    "")
            );
            repo.save(
                    new Coin()
                            .coinCode(UUID.randomUUID().toString())
                            .coinName("Dolar")
                            .dateOfProduction("2011")
                            .id(3422L)
                            .prizePln(4)
                            .imageUrl("data:image/jpeg;base64,")
            );
        };

    }

    @Bean
    public CommandLineRunner stampDateToInitDb(StampRepository stampRepository) {
        return args -> stampRepository.save(
                new Stamp()
                        .stampCode(UUID.randomUUID().toString())
                        .stampName("Boks -  Lukaszewski, Karczamarczyk")
                        .id(10L)
                        .dateOfProduction("1920")
                        .imageUrl("https://d-art.ppstatic.pl/kadry/k/r/1/63/f7/5c3107bdb391e_o_large.jpg")
                        .prizePln(10000)
        );
    }

    @Bean
    public CommandLineRunner watchDateToInitDb(WatchRepository watchRepository) {
        return args -> watchRepository.save(
                new Watch()
                        .watchCode(UUID.randomUUID().toString())
                        .watchName("Rolex")
                        .id(10L)
                        .weight(200)
                        .dateOfProduction("2021")
                        .imageUrl("https://cdn2.chrono24.com/images/uhren/20539141-icn63vq724bzcvjx26uvhg4f-ExtraLarge.jpg")
                        .prizePln(60000)
        );
    }

    @Bean
    public CommandLineRunner user(RoleRepository repository) {
        return args -> {

            repository.save(
                    new Role()
                            .name(ERole.ROLE_USER)
            );
            repository.save(
                    new Role()
                            .name(ERole.ROLE_ADMIN)
            );
            repository.save(
                    new Role()
                            .name(ERole.ROLE_MODERATOR)
            );
        };

    }

}
